(1, 'من نحن', 'About Us', '<p align=\"right\" class=\"Heading01\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\">قال تعالى ( فَمَنْ يَعْمَلْ مِثْقَالَ ذَرَّةٍ خَيْرًا يَرَهُ ) ( سورة الزلزلة / الآية 7 )</span><span style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\"><o:p></o:p></span></p>\r\n\r\n<p align=\"right\" class=\"Heading01\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\">صدق الله العظيم<o:p></o:p></span></p>\r\n\r\n<p align=\"right\" class=\"Heading01\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:right\"><span dir=\"RTL\" lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\">&nbsp;<o:p></o:p></span></p>\r\n\r\n<p class=\"Heading01\" dir=\"RTL\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:justify;direction:rtl;unicode-bidi:embed\"><span lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\">تُعدّ الخدمة الاجتماعية من أهمّ المِهن على الإطلاق؛حيث يكتسب الفرد عدّة مهارات عديدة&nbsp; و يتعزّز إنتماؤه للمجتمع المحليّ والإنساني، وسيمتلك روح العمل التعاوني ، وتمنحه القدرة على تحمّل المسؤولية، وتؤكّد على قيم العمل والوقت والنظام، وتحثّ الفرد على جعل تفكيره أكثر واقعية، وتزيد من قدرته على حلّ المشاكل بتفكير واعٍ وسليم، وتزيد من المهارات الفكرية.</span><span dir=\"LTR\" lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\"> </span><span lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\"><o:p></o:p></span></p>\r\n\r\n<p class=\"Heading01\" dir=\"RTL\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:justify;direction:rtl;unicode-bidi:embed\"><span lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\"><o:p>&nbsp;</o:p></span></p>\r\n\r\n<p class=\"Heading01\" dir=\"RTL\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:justify;direction:rtl;unicode-bidi:embed\"><span lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\">مرضى الأسنان عددهم كبير (حيث بلغت&nbsp; نسبة التسوس في المملكة لعمر 6 سنوات 96% و لعمر 12 سنة 93.6%) </span><span lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:10.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\">إحصائية 1439هـ </span><span lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:113%; mso-ansi-language:EN-US; mso-ligatures:none\">، وللأسف كثير من مرضى الأسنان ليس لديهم علم بعيادات الأسنان المتوفرة بجامعات الاسنان والتي يصل عددها في الجامعة الواحدة إلى أكثر من 200 عيادة أسنان عامة وتخصصية ، مما استدعى إلى تزاحم المرضى في عيادات الأسنان التخصصية &nbsp;و العامة .<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:justify;text-indent:36.0pt;mso-pagination:none;direction:rtl;\r\nunicode-bidi:embed\"><span lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:118%; mso-ligatures:none\">و من هذا المنطلق و إيجاد حلقة و صل بين أطباء الأسنان الدارسين بجامعات الأسنان الذي يبلغ عددهم في 2018م إلى أكثر من 12488 موزعين على 27 كلية طب أسنان (19 جامعة حكومية، 8 جامعات خاصة) و تسهيل مسيرتهم العلمية بعلاج عدد معين من حالات الأسنان، و كذلك تسهيلا للمرضى لتلقي علاج الأسنان.</span><span dir=\"LTR\" lang=\"EN-GB\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:118%; mso-ligatures:none\"><o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" dir=\"RTL\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;\r\ntext-align:justify;mso-pagination:none;direction:rtl;unicode-bidi:embed\"><span lang=\"AR-SA\" style=\"color:black; font-family:adobe arabic; font-size:15.0pt; line-height:118%; mso-ligatures:none\">فلذلك تم و لله الحمد إعداد برنامج طبيب أسنان مجاني ليقدم خدماته لكافة شرائح المجتمع و جميع الجنسيات و مختلف الأعمار و التخصصات (حشوات أسنان، تركيبات ثابتة و متحركة، علاج &nbsp;عصب و جذور الاسنان، و علاج اللثة, أسنان الأطفال، جراحة الأسنان).<o:p></o:p></span></p>\r\n\r\n<p><em style=\"color:black; font-family:adobe arabic; font-size:15pt; font-style:italic; text-align:justify\">مع تمنياتنا لكم بدوام الصحة و العافية</em><span style=\"color:transparent; font-family:sans-serif; font-size:22.5px; text-align:initial; white-space:pre\">ه</span></p>\r\n', '<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p><span dir=\"RTL\">قال تعالى ( فَمَنْ يَعْمَلْ مِثْقَالَ ذَرَّةٍ خَيْرًا يَرَهُ )&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (سورة الزلزلة / الآية 7 ) صدق الله العظيم. </span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Social service is one of the most&nbsp;&nbsp;&nbsp; important occupations of all time, where the individual acquire several skills and strengthens his belonging to the community and humanitarian, and will have the spirit of cooperative work, and give him the ability to take responsibility, and emphasizes the values ​​of work, time ,order, and urges the individual to make his thinking more realistic, and increase his ability to solve&nbsp;&nbsp; problems with creative&nbsp; thinking and sound, and increase intellectuality and skills.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>There are a large number of dental patients (where the percentage of caries in the Kingdom for the age of 6 years 96% and for the age of 12 years 93.6%) statistic 1439AH, and unfortunately many dental patients are not aware of dental clinics available in dental universities, which number in the university to more than 200 clinics General and specialized dentistry, which led to contention of patients in specialized and public dental clinics.</p>\r\n\r\n<p>From this standpoint, we found a link between the dentist studying in dental university (in 2018 more than 12,488)distributed in 27 dentistry faculties (19 government, 8 private) and facilitate their scientific career by treating a certain number of dental cases, as well as to facilitate for patients to receive dental treatment.</p>\r\n\r\n<p>Therefore, we have prepared a free dentist services to provide all&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; segments of society, all nationalities and&nbsp;&nbsp; different ages and disciplines (dental fillings, fixed and removable prosthetics, root canal treatment, scaling and polishing, pediatric dentistry and dental surgery).</p>\r\n', 1, '1552317266.png', 11, '2019-03-11 13:14:26', '2019-10-02 14:04:11'),
(2, 'سياسة الخصوصية', 'Privacy Policy', '<p dir=\"RTL\"><strong>سياسة الخصوصية</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">هي منصة تمكن المرضى من جميع الجنسيات لتلقي خدمة طبيب اسنان مجاني لدى الأطباء المتدربين الجامعيين في مستشفيات الاسنان الجامعية &nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">تصف سياسة الخصوصية هذه، كيفية ومتى نجمع معلوماتك ونستخدمها ونشاركها عبر برامجنا/مواقعنا الإلكترونية والرسائل القصيرة وواجهات برمجة التطبيقات وإشعارات البريد الإلكتروني والتطبيقات والبرامج والأزرار والإعلانات وخدمات التجارة والخدمات الأخرى التي يتم تغطيتها والتي ترتبط بهذه السياسة ) وبشكل عام نسميها،</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">&quot;الخدمات&quot;(، ومن شركائنا وأطراف أخرى. على سبيل المثال ،ترسل إلينا معلومات عند استخدام خدماتنا على الويب أو عبر الرسائل القصيرة أو من برنامج/تطبيق أنشأناه على الأجهزة. عند استخدام أي من خدماتنا، فإنك توافق على جمع معلوماتك ونقلها وتخزينها والإفصاح عنها واستخدامها كما هو موضح في سياسة الخصوصية هذه. ويشمل ذلك أي معلومات تختار تقديمها تعتبر حساسة بموجب القانون المعمول به.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:21.6pt\">عندما تشير هذه السياسة &quot;نحن&quot; أو &quot;لنا&quot;، فإنه يشير إلى وحدة تحكم المعلومات الخاصة بك بموجب هذه السياسة. يتم التحكم في المعلومات الخاصة بك من قبل )طبيب أسنان مجاني(. وعلى الرغم من ذلك، فإنك وحدك تتحكم في نشر المحتوى الذي تقدمه من خلال الخدمات، كما هو منصوص عليه في بنود الخدمة وقواعد )طبيب أسنان مجاني(.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:12.4pt\">وبغض النظر عن البلد الذي تعيش فيه، فإنك تفوضنا بنقل وتخزين واستخدام المعلومات الخاصة بك في أي بلد نعمل فيه. وفي بعض هذه البلدان، قد تختلف قوانين وقواعد حماية الخصوصية والبيانات المتعلقة بوقت وصول السلطات الحكومية إلى البيانات عن تلك الموجودة في البلد الذي تعيش فيه.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">إذا كان لديك أي أسئلة أو تعليقات حول سياسة الخصوصية هذه، يرجى تقديم طلب من خلال نموذج لدينا، وهي متاحة في مواقع/برامج )طبيب أسنان مجاني(.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>جمع المعلومات واستخدامها</strong></p>\r\n\r\n<p dir=\"RTL\">نجمع معلوماتك ونستخدمها لتقديم خدماتنا وفهمها وتحسينها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">معلومات الحساب الأساسية: إذا اخترت إنشاء حساب عند )طبيب أسنان مجاني(، يجب أن تقدم لنا بعض المعلومات الشخصية، مثل اسمك أو اسم المستخدم أو كلمة المرور أو عنوان البريد الإلكتروني أو رقم الهاتف. على تطبيق/برنامج )طبيب أسنان مجاني(، يتم سرد اسمك واسم المستخدم علنا، بما في ذلك على صفحة ملفك الشخصي وفي نتائج البحث ،ويمكنك استخدام إما اسمك الحقيقي أو اسم مستعار. يمكنك إنشاء وإدارة حسابات متعددة عند )طبيب أسنان مجاني(. إذا كنت تستخدم تطبيقات )طبيب أسنان مجاني(، فمعلومات الاتصال بك والتي تقدمها لتسجيل الدخول ليست عامة للناس بل مخصصة للمرضى و الأطباء فيمابينهم المستفيدين من الخدمة. بعض من ميزات منتجاتنا، مثل البحث وعرض ملامح المستخدمين العامة أو مشاهدة البث على خدمات )طبيب أسنان مجاني(، والتي لا تتطلب منك إنشاء حساب.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:8.6pt\"><strong>معلومات الاتصال</strong>: يمكنك استخدام معلومات الاتصال الخاصة بك، مثل عنوان البريد الإلكتروني أو رقم الهاتف وغيرها، لتخصيص حسابك أو تمكين ميزات حساب معينة ،على سبيل المثال، للتحقق من تسجيل الدخول أو تطبيقات )طبيب أسنان مجاني( عبر الرسائل القصيرة او ما سواها. إذا قمت بتزويدنا برقم هاتفك، فإنك توافق على تلقي رسائل نصية إلى هذا الرقم منا. يجوز لنا استخدام معلومات الاتصال الخاصة بك لإرسال معلومات عن خدماتنا أو تسويقها أو المساعدة على منع الرسائل غير المرغوب فيها أو الاحتيال أو إساءة الاستخدام ومساعدة الآخرين في العثور على حسابك، بما في ذلك من خلال خدمات الجهات الخارجية وتطبيقات (المستخدم). يمكنك استخدام الإعدادات المتوفرة للتحكم في الإشعارات التي تتلقاها من تطبيقات )طبيب أسنان مجاني(. إعدادات الخصوصية الخاصة بك تتحكم ما إذا كان الآخرون يمكن أن يجدوك على تطبيقات )طبيب أسنان مجاني( عن طريق عنوان البريد الإلكتروني الخاص بك أو رقم الهاتف أو غيرها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:12.8pt\"><strong>معلومات إضافية</strong>: إذا راسلتنا عبر البريد الإلكتروني، قد نحتفظ برسالتك وعنوان البريد الإلكتروني ومعلومات الاتصال للرد على طلبك. إذا ربطت حسابك على خدماتنا إلى حسابك على خدمة أخرى من أجل المشاركة بين خدماتنا وهذه الخدمة، قد ترسل خدمة أخرى لنا تسجيل أو تعريف المعلومات الخاصة بك على هذه الخدمة وغيرها من المعلومات التي لديك صرحت لها. وتمكن هذه المعلومات من النشر بينها، وتساعدنا في تحسين الخدمات، وقد نحتفظ بها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:6.2pt\"><strong>الرسائل ،المتابعات، القوائم، الملف الشخصي، وغيرها من المعلومات العامة</strong>: معظم المعلومات التي تقدمها لنا من خلال خدمات )طبيب أسنان مجاني( هي المعلومات التي تطلب منا أن تكون معلونة للجمهور. يمكنك تزويدنا بالمعلومات الشخصية لجعل الجمهور على خدمات )طبيب أسنان مجاني(، مثل سيرة قصيرة، موقعك، موقع الويب الخاص بك، وتاريخ الميلاد، أو صورة. بالإضافة إلى ذلك، تتضمن معلوماتك العامة الرسائل التي ترسلها؛ البيانات الوصفية المقدمة معهم، مثل عند إرسال وتطبيق (المستخدم) الذي اعتدت إرساله؛ معلومات عن حسابك، مثل وقت الإنشاء واللغة والبلد والمنطقة الزمنية؛ والقوائم التي تنشئها، والأشخاص الذين تتابعهم. يقوم )طبيب أسنان مجاني( على نطاق واسع وعلى الفور نشر المعلومات العامة لمجموعة واسعة من المستخدمين والعملاء، والخدمات، بما في ذلك محركات البحث والمطورين والناشرين التي تعمل على دمج محتوى )طبيب أسنان مجاني( إلى خدماتهم ،ومنظمات مثل الجامعات، ووكالات الصحة العامة، وشركات أبحاث السوق التي تحلل المعلومات عن الاتجاهات والرؤى. عند مشاركة معلومات أو محتوى مثل الصور ومقاطع الفيديو والروابط عبر الخدمات، يجب أن تفكر مليا في ما تعلنه بشكل عام. قد نستخدم هذه المعلومات لإجراء استدلالات، مثل الموضوعات التي قد تكون مهتم بها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:10.6pt\"><strong>الرسائل المباشرة والاتصالات غير العامة</strong>: نقدم بعض الميزات التي تتيح لك التواصل بشكل أكثر خصوصية. على سبيل المثال، يمكنك استخدام الرسائل المباشرة لإجراء محادثات خاصة مع مستخدمي برامج )طبيب أسنان مجاني( الآخرين. عند التواصل بشكل خاص مع الآخرين من خلال خدماتنا، مثل إرسال الرسائل المباشرة واستلامها، سنقوم بتخزين ومعالجة اتصالاتك والمعلومات المتعلقة بها. يرجى ملاحظة أنه إذا كنت تتفاعل مع محتوى )طبيب أسنان مجاني( العامة المشتركة معك عبر رسالة مباشرة، على سبيل المثال عند عمل لايك على رسالة مشتركة عبر رسالة مباشرة، تلك التفاعلات قد تكون عامة. في حين أن ميزات مثل الرسائل المباشرة يقصد بها أن تكون خاصة، يرجى تذكر أن المستلمين قد ينسخ ويخزن ويعيد مشاركة محتويات الاتصالات الخاصة بك.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:13.8pt\"><strong>معلومات الموقع:</strong> قد نتلقى معلومات حول موقعك. على سبيل المثال، يمكنك اختيار نشر موقعك في رسائلك وفي ملفك الشخصي )طبيب أسنان مجاني(. قد تخبرنا أيضا موقعك عند تعيين موقع الاتجاه الخاص بك على برامج )طبيب أسنان مجاني(. وقد نحدد أيضا الموقع باستخدام بيانات أخرى من جهازك، مثل معلومات الموقع الدقيقة من نظام تحديد المواقع العالمي )<span dir=\"LTR\">GPS</span>(، ومعلومات عن الشبكات اللاسلكية أو أبراج الجوال بالقرب من جهازك الجوال، أو عنوان الشبكة الخاص بك. يجوز لنا استخدام معلومات حول موقعك وتخزينها لتوفير ميزات خاصة في خدماتنا، مثل المراسلة مع موقعك، وتحسين الخدمات وتخصيصها، على سبيل المثال، بمحتوى أكثر ملاءمة مثل الاتجاهات والقصص والإعلانات والاقتراحات المحلية للأشخاص.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>الروابط:</strong> يجوز لنا تتبع كيفية تفاعلك مع الروابط عبر خدماتنا، بما في ذلك إشعارات البريد الإلكتروني وخدمات الجهات الخارجية وتطبيقات (المستخدم)، وذلك عن طريق إعادة توجيه النقرات أو من خلال وسائل أخرى. ونحن نفعل ذلك للمساعدة في تحسين خدماتنا، وتقديم إعلانات أكثر ملاءمة، ولنتمكن من مشاركة إحصاءات النقرات المجمعة مثل عدد المرات التي تم فيها النقر على رابط معين. ستتم معالجة الروابط والرسائل والاتصالات غير العامة مثل الرسائل المباشرة المشتركة على الخدمات وتقصير الروابط إلى عنوان قصير عن طريق خدمة تقصير الروابط.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>ملفات تعريف الارتباط </strong><strong><span dir=\"LTR\">Cookies</span></strong><strong>:</strong> تستخدم العديد من مواقع الويب والبرامج ملفات تعريف الارتباط والتقنيات المشابهة لجمع بيانات إضافية عن استخدام مواقع الويب</p>\r\n\r\n<p dir=\"RTL\">وتحسين خدماتنا. ملف تعريف الارتباط هو ملف بيانات صغير يتم نقله إلى جهازك. يجوز لنا استخدام ملفات تعريف الارتباط للجلسات وملفات تعريف الارتباط الدائمة لفهم كيفية تفاعلك مع خدماتنا بشكل أفضل، ومراقبة الاستخدام الإجمالي من قبل المستخدمين وتوجيه حركة المرور على الويب على خدماتنا، ولتخصيص خدماتنا وتحسينها. على الرغم من أن معظم متصفحات الويب تقبل ملفات تعريف الارتباط تلقائيا، يمكن تعديل بعض إعدادات المتصفحات لرفض ملفات تعريف الارتباط أو تنبيهك عندما يحاول موقع ويب وضع ملف تعريف ارتباط على جهاز الكمبيوتر الخاص بك. ومع ذلك، قد لا تعمل بعض الخدمات بشكل صحيح إذا قمت بتعطيل ملفات تعريف الارتباط.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>استخدام خدماتنا:</strong> نتلقى معلومات منك/عنك عند التفاعل مع خدماتنا، حتى إذا لم تكن قد أنشأت حسابا )&quot;بيانات السجل&quot;(. على سبيل المثال، عند زيارة مواقعنا الإلكترونية أو تسجيل الدخول إلى خدماتنا أو التفاعل مع إشعارات البريد الإلكتروني أو استخدام حسابك للمصادقة على موقع ويب أو تطبيق أو خدمة تابعة لجهة خارجية أو زيارة موقع ويب أو تطبيق أو خدمة تابعة لجهة خارجية يتضمن تطبيقات )طبيب أسنان مجاني( زر أو أمر، فقد تتلقى معلومات عنك. قد تتضمن بيانات السجل هذه عنوان الشبكة أو نوع المتصفح أو نظام التشغيل أو صفحة الويب المحالة أو الصفحات التي تمت زيارتها أو الموقع أو مشغل شبكة الجوال أو معلومات الجهاز )بما في ذلك أرقام تعريف الجهاز والتطبيق( أو عبارات البحث أو معلومات ملفات تعريف الارتباط. كما نتلقى بيانات السجل عند النقر على عرض شيء أو التفاعل مع الروابط على خدماتنا، بما في ذلك وصلات إلى تطبيقات الطرف الثالث، مثل عند اختيار تثبيت تطبيق آخر من خلال تطبيقات )طبيب أسنان مجاني( / الشبكات. نستخدم بيانات السجل لإجراء استدلالات، مثل الموضوعات التي قد تكون مهتما بها، وتخصيص المحتوى الذي نعرضه لك، بما في ذلك الإعلانات. نحن نحافظ على بيانات السجل حسب الحاجة للأغراض الموضحة في سياسة الخصوصية هذه.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>بيانات القطعة </strong><strong><span dir=\"LTR\">Widget</span></strong><strong>:</strong> يمكننا تخصيص الخدمات لك استنادا إلى زياراتك إلى مواقع ويب تابعة لجهات خارجية والتي تدمج أزرار برامج )طبيب أسنان مجاني( أو الأدوات.</p>\r\n\r\n<p dir=\"RTL\">عندما تقوم هذه المواقع أولا بتحميل أزرارنا أو أدواتنا للعرض، نتلقى بيانات السجل التي تتضمن صفحة الويب التي زرتها وملف تعريف الارتباط الذي يعرف متصفحك</p>\r\n\r\n<p dir=\"RTL\">)&quot;بيانات القطعة&quot;(.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:21.8pt\"><strong>خدمات التجارة:</strong> يمكنك تقديم معلومات الدفع، بما في ذلك رقم بطاقة الائتمان أو الخصم، وتاريخ انتهاء صلاحية البطاقة، ورمز السري، وأنواع الدفع الأخرى، وعنوان إرسال الفواتير )يشار إليه معا باسم &quot;معلومات الدفع&quot;(، إلى جانب عنوان الشحن، لإكمالها من خلال خدماتنا. لتسهيل عمليات الشراء المستقبلية، نخزن معلومات الدفع</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:11.4pt\">)باستثناء رمز السري للبطاقة( وعنوان الشحن. نحن نعتبر معلومات الدفع وعنوان الشحن خاصة ولا نجعل هذه المعلومات عامة. لتسهيل تنفيذ الطلب، نقوم بجمع وتخزين المعلومات التي تم إنشاؤها بواسطة عمليات الشراء التي تتم من خلال خدماتنا )&quot;بيانات المعاملة&quot;(. قد تتضمن بيانات المعاملة اسم التاجر وتاريخ ووقت وقيمة المعاملة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:7.4pt\"><strong>الإعلان:</strong> خدماتنا مدعومة بالإعلانات. يجوز لنا استخدام المعلومات الموضحة في سياسة الخصوصية هذه للمساعدة في جعل إعلاناتنا أكثر ملاءمة لك ولقياس فعاليتها وللمساعدة في التعرف على أجهزتك لعرض إعلاناتك على برامج )طبيب أسنان مجاني( وإيقافها. على سبيل المثال، عند التفاعل مع المحتوى في تطبيق )طبيب أسنان مجاني( لأجهزة ما، قد نعرض محتوى )بما في ذلك الإعلانات( حول تلك المواضيع نفسها عند استخدام )طبيب أسنان مجاني( على الويب. نحن لا نستخدم المحتوى الذي تشاركه بشكل خاص في الرسائل المباشرة لعرض إعلاناتك. كما تحظر سياسة إعلانات )طبيب أسنان مجاني( على المعلنين استهداف الإعلانات استنادا إلى فئات نعتبرها حساسة، مثل العرق أو الدين أو السياسة أو الحياة الجنسية أو الصحة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>الأطراف الثالثة والشركات التابعة:</strong> قد نتلقى معلومات عنك من جهات خارجية، مثل مستخدمي )طبيب أسنان مجاني( الآخرين، والشركاء )بما في ذلك الشركاء في الإعلانات(، أو الشركات التابعة لنا. على سبيل المثال، قد يشارك المستخدمون الآخرون معلومات عنك أو يكشفونها، مثل عندما يشاركونك أو يشاركون صورة لك أو يضعون علامة باسمك في صورة. تتحكم إعدادات الخصوصية في تحديد الأشخاص الذين يمكنهم وضع علامة باسمك في إحدى الصور. يمكن لشركاء الإعلانات والشركات التابعة لنا مشاركة المعلومات معنا مثل معرف ملف تعريف ارتباط المتصفح أو معرف جهاز الجوال أو تجزئة التشفير لمعرف حساب مشترك )مثل عنوان البريد الإلكتروني(، فضلا عن البيانات السكانية أو الاهتمامات والمحتوى المعروض أو الإجراءات المتخذة على موقع ويب أو تطبيق. قد يسمح لنا شركاؤنا في الإعلانات، ولا سيما معلنينا، بجمع معلومات مماثلة مباشرة من موقعهم الإلكتروني أو تطبيقهم من خلال دمج تقنية الإعلانات.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>تبادل المعلومات والإفصاح عنها</strong></p>\r\n\r\n<p dir=\"RTL\">نحن لا تكشف عن المعلومات الشخصية الخاصة بك إلا في ظروف محدودة وصفها هنا.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:6.0pt\"><strong>موافقة المستخدم أو توجيهه:</strong> يجوز لنا مشاركة معلوماتك أو الإفصاح عنها في اتجاهك، مثل عند تفويض (مستخدم) ويب أو تطبيق ويب تابع لجهة خارجية للدخول إلى حسابك أو عند توجيهنا لمشاركة تعليقاتك مع نشاط تجاري. عند استخدام تطبيقات )طبيب أسنان مجاني( للتسجيل أو تسجيل الدخول إلى تطبيق طرف ثالث ،كتبادل معلومات الاتصال الخاصة بك، مثل رقم الهاتف الخاص بك، مع هذا التطبيق. إذا كنت قد شاركت المعلومات، مثل الرسائل المباشرة أو الرسائل المحمية، مع مستخدم آخر يقوم بالوصول إلى برامج )طبيب أسنان مجاني( من خلال خدمة من جهة خارجية، ضع في اعتبارك أنه يمكن مشاركة المعلومات مع خدمة الجهات الخارجية.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>مقدمي الخدمات:</strong> نشرك مقدمي الخدمات لأداء وظائف وتقديم الخدمات لنا في عدة بلدان. على سبيل المثال، نستخدم مجموعة متنوعة من خدمات الجهات الخارجية للمساعدة في توفير خدماتنا، مثل استضافة مدوناتنا المختلفة وصفحات ويكي، ومساعدتنا على فهم استخدام خدماتنا وتحسينها، مثل غوغل أناليتيكش. يجوز لنا مشاركة معلوماتك</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">الشخصية الخاصة مع مقدمي الخدمات الخاضعين لالتزامات تتفق مع سياسة الخصوصية هذه وأي تدابير سرية وأمنية أخرى مناسبة. نحن نشارك معلومات الدفع الخاصة بك مع مقدمي خدمات الدفع لمعالجة المدفوعات؛ منع وكشف والتحقيق في حالات الغش أو غيرها من الأنشطة المحظورة؛ تسهيل تسوية المنازعات مثل عمليات رد المبالغ المدفوعة أو رد الأموال؛ ولأغراض أخرى مرتبطة بقبول بطاقات الائتمان أو بطاقات السحب الآلي.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>المعاملات التجارية:</strong> إذا قمت بإجراء الدفع كجزء من معاملة تجارية من خلال خدماتنا، فقد نوفر للبائع أو مزود التجارة أو السوق أو المؤسسة الخيرية اسمك وعنوان البريد الإلكتروني وعنوان الشحن ومعلومات الدفع وبيانات المعاملات لتسهيل معالجة الدفع ، وتعبئة بيانات الطلب، وتسوية المنازعات )بما في ذلك المنازعات المتعلقة بالدفع والشحن( والمساعدة في منع الغش أو غيره من الأنشطة المحظورة والكشف عنها والتحقيق فيها. يرجى الرجوع إلى سياسات خصوصية هذه الجهات الخارجية للحصول على معلومات حول ممارسات الخصوصية.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>القانون والضرر:</strong> بغض النظر عن أي شيء يتعارض مع سياسة الخصوصية هذه، يجوز لنا الحفاظ على معلوماتك أو الإفصاح عنها إذا رأينا أن من الضروري بشكل معقول الامتثال لقانون أو لائحة أو إجراءات قانونية أو طلب حكومي؛ لحماية سلامة أي شخص؛ لمعالجة قضايا الاحتيال أو الأمن أو المسائل التقنية؛ أو لحماية حقوقنا أو حقوق مستخدمينا أو ممتلكاتنا. ومع ذلك، لا يوجد شيء في سياسة الخصوصية هذه يهدف إلى الحد من أي دفاعات قانونية أو اعتراضات قد تكون لديك لطرف ثالث، بما في ذلك الحكومة، وطلب الكشف عن المعلومات الخاصة بك.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>تحويلات الأعمال والشركات التابعة:</strong> في حال وقوعنا في حالة إفلاس أو اندماج أو اقتناء أو إعادة تنظيم أو بيع أصول، قد يتم بيع معلوماتك أو نقلها كجزء من تلك المعاملة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:19.8pt\">وستسري سياسة الخصوصية هذه على معلوماتك على أنها نقلت إلى الكيان الجديد. وقد نكشف أيضا معلومات عنك إلى الشركات التابعة لنا للمساعدة في توفير الخدمات وفهمها وخدماتنا التابعة لنا وفهمها وتحسينها، بما في ذلك تقديم الإعلانات.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>المعلومات العامة أو غير الشخصية:</strong> يجوز لنا مشاركة معلوماتك العامة أو المجمعة أو غير الشخصية أو الكشف عنها، مثل معلومات الملف الشخصي للمستخدم العام ،والرسائل العامة، والأشخاص الذين تتابعهم أو الذين يتبعونك، وعدد مرات تفاعل الأشخاص مع رسالة )على سبيل المثال، عدد المستخدمين الذين نقروا على رابط معين أو صوتوا على استطلاع للرأي في إحدى الرسائل، حتى لو لم يفعلوا ذلك سوى(، أو عرض تقارير على المعلنين حول المستخدمين الفريدين الذين شاهدوا إعلاناتهم أو نقروا عليها بعد إزالتها وأي معلومات شخصية خاصة )مثل اسمك أو معلومات الاتصال(. معلومات أخرى، مثل اسمك واسم المستخدم، هو دائما عام على خدمات )طبيب أسنان مجاني(.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>الوصول إلى معلوماتك الشخصية وتعديلها</strong></p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:7.0pt\">إذا كنت مستخدما مسجلا لخدماتنا، فإننا نوفر لك الأدوات وإعدادات الحساب للدخول إلى المعلومات الشخصية التي قدمتها إلينا والمرتبطة بحسابك أو تصحيحها أو حذفها أو تعديلها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">ضع في اعتبارك أن محركات البحث والأطراف الثالثة الأخرى قد تحتفظ بنسخ من معلوماتك العامة، مثل معلومات الملف الشخصي للمستخدم والرسائل العامة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>عملياتنا العالمية</strong></p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">وكما هو موضح في سياسة الخصوصية هذه، يجوز لنا مشاركة المعلومات مع الشركات التابعة لنا والجهات الخارجية، وقد يطلب منك الكشف عن المعلومات استجابة لطلبات حكومية مقبولة، بما في ذلك بموجب متطلبات إنفاذ القانون أو متطلبات الأمن القومي المعمول بها.&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>تغييرات على هذه السياسة</strong></p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:14.6pt\">يجوز لنا مراجعة سياسة الخصوصية هذه من وقت لآخر. أحدث إصدار من السياسة تحكم استخدامنا للمعلومات الخاصة بك ستكون دائما في موقع&nbsp; )طبيب أسنان مجاني( تحت عنوان الخصوصية/سياسة الخصوصية. من خلال الاستمرار في الوصول إلى الخدمات أو استخدامها بعد أن تصبح هذه التغييرات فعالة، فإنك توافق على الالتزام بسياسة الخصوصية المنقحة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>المصطلحات </strong></p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:-.55pt\"><strong>برنامج/البرنامج/تطبيق:</strong> يستخدم مصطلح &quot;<strong>البرنامج</strong>&quot; الوارد في هذه الوثيقة للإشارة إلى البرنامج الأصلي والنسخ الكاملة أو الجزئية من البرنامج/التطبيق/الموقع الالكتروني/الخدمة الالكترونية. ويتكون البرنامج من تعليمات مقروءة للحاسب ومكونات البرنامج والبيانات والمحتوى السمعي-البصري )مثل الصور والنصوص والتسجيلات( وكل ما يتعلق بالبرنامج من المواد المرخصة.</p>\r\n\r\n<p><strong><span dir=\"RTL\">جهاز/حاسب:</span></strong><span dir=\"RTL\"> جهاز الكتروني، مثل حاسب آلي/جوال/تابلت/خادم/حاسب افتراضي/جهاز تخزين</span></p>\r\n', '<p><strong>Privacy policy</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>It is a platform that enables patients of all nationalities to receive a free dentist service from university interns at university dental hospitals.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This Privacy Policy describes how and when we collect, use, and share your information across our programs / websites, SMS, APIs, email notifications, applications, software, buttons, advertisements, trade services and other services covered which are linked to this policy) and in general we call it &quot;Services&quot;, and from our partners and third parties.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For example, you send us information when you use our services on the web, via SMS, or from a program /application we have created on devices. By using any of our services, you agree to collect, transfer, and store and disclose your information and use it as described in this Privacy Policy, including any information you choose to provide that is sensitive under applicable law.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When this policy refers to &quot;us&quot; or &quot;us&quot;, it refers to your information controller under this policy. Your information is controlled by (Free Dentist). However, you alone control the dissemination of the content you provide through the Services, as set forth in the Terms of Service and (Free Dentist) Rules.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>No matter what country you live in, you authorize us to transfer, store and use your information in any country where we operate. In some of these countries, privacy and data protection laws and rules on when government authorities access data may differ from those in the country where you live.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\nIf you have any questions or comments about this privacy policy, please apply through our form, available at websites / programs (free dentist).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Collection and use of information</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We collect and use your information to provide, understand and improve our services.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Basic Account Information:</strong> If you choose to create an account at (Free Dentist), you must provide us with some personal information, such as your name, username, password, email address or phone number.</p>\r\n\r\n<p>&shy;&shy;&shy;</p>\r\n\r\n<p>Your name and username are listed publicly, including on your profile page and in search results, and you can use either your real name or an alias. You can create and manage multiple accounts at (Free Dentist). And that you provide for login is not public for people but for patients and dentists is private. Some of the features of our products, such as searching and viewing general user profiles or watching broadcasts on (Free Dentist) services, do not require you to create an account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Additional Information:</strong> If you email us, we may retain your message, email address and contact information to respond to your request.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you link your account on our services to your account on another service in order to share our services with this service, another service may send us a registration or identification of your information on this service and other information that you have authorized.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This information enables them to be disseminated, helps us to improve services, and we may retain them. Messages, follow-ups, menus, profile, and other general information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Most of the information you provide to us through (Free Dentist) services is information that asks us to be publicly available. Such as a short biography, your location, your website, date of birth, or a photo. In addition, your general information includes messages you send, Creation time, language, country and time zone That you create, and the people you follow. Free Dentist (widely and instantly disseminate public information to a wide range of users, customers, and services, including search engines, developers and publishers that integrate content) Free Dentist (to their services, organizations such as universities, public health agencies, research companies When you share information or content such as photos, videos, and links across services, you should think carefully about what you publicly announce, and we may use this information to make inferences, such as topics you might be interested in.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Direct messaging and non-public communications:</strong> We offer some features that allow you to communicate more privately.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For example, you can use direct messages to have private conversations with other users of a free dentist program. When you communicate privately with others through our services, such as sending and receiving direct messages, we will store and process your communications and related information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please note that if you interact with public (free dentist) content shared with you via direct message, for example when Lake works on a shared message via direct message, those interactions may be public. While features such as direct messages are intended to be private, please remember that Recipients may copy, store, and restore the contents of your hip communications.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Location information:</strong> We may receive information about your location. For example, you can choose to publish your location in your messages and in your profile (free dentist).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>You may also tell us your location when you set your direction location to (free dentist) programs. We may also determine the location using other data from your device, such as location information about wireless networks or mobile towers near your mobile device, or your network address.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We may use and store information about your location to provide special features in our services, such as messaging with your location, improving and customizing services, For example, with more relevant content such as a trend The stories and suggestions for local people.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Links:</strong> We may track how you interact with links across our services, including email notifications, third-party services, and (user) apps, by redirecting clicks or through other means.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We do this to help improve our services, deliver more relevant ads, and be able to share aggregate click statistics such as the number of times a particular link was clicked. Links, messages and non-public communications such as direct messages shared on the Services and shortening of links to a short address will be handled by the Shortening Service.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Cookies</strong>: Many websites and programs use cookies and similar technologies to collect additional data about the use of websites and improve our service. A cookie is a small data file that is transferred to your device.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We may use session cookies and persistent cookies to better understand how you interact with our services, Monitor the overall use by users and direct web traffic to our services, and to customize and improve our services.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Although most web browsers automatically accept cookies, some browser settings can be modified to reject cookies or alert you when a website tries to place a cookie on your computer. However, some services may not work correctly if you disable cookies.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Use of our Services</strong>: We receive information from you / about you when interacting with our services, even if you have not created an account (&ldquo;Registration Data&rdquo;).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For example, when you visit our websites, log into our services, interact with email notifications, or use your account to authenticate On a third-party website, application, or service, or visit a third-party website, application, or service that includes a button or command, you may receive information about you.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This log data may include the network address, browser type, operating system, referred webpage, pages visited, site, carrier, device information (including device and app IDs), search terms, or cookie information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We receive log data when you click to view something or interact with links on our services, including links to third-party applications, such as when you choose to install another application through apps (free dentist) / networks. You may be interested in them; customize the tastiest content We maintain log data as needed for the purposes described in this Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Widget data:</strong> We can customize services for you based on your visits to third-party websites that incorporate software buttons (free dentist) or tools.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When these sites first load our buttons or tools for viewing, we receive log data that includes the webpage you visited and the cookie that identifies your browser (&quot;Widget data&quot;).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Trade Services</strong>: You can provide payment information, including credit or debit card number, card expiration date, secret code, other payment types, and billing address (together referred to as &quot;payment information&quot;), along with shipping address, to be completed from to facilitate future purchases, we store payment information (Excluding card secret code) and shipping address.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We consider payment information and shipping address private and do not make this information public. To facilitate order execution, we collect and store information generated by purchases made through our services (&quot;Transaction Information&quot;). Transaction information Merchant name, date, time and value of the transaction.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Advertising</strong>: Our services are supported by advertising. We may use the information described in this privacy policy to help make our ads more relevant to you, to measure their effectiveness, and to help identify your devices to show and stop your ads on (free dentist) programs. We may not display content (including ads) on those same topics when you use (free dentist) on the web.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Target ads based on categories we consider Here are sensitive, such as race, religion, politics or sex life or health.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Third parties and affiliates: </strong>We may receive information about you from third parties, such as other (free dentist) users, partners (including advertising partners), or our affiliates.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>For example, other users may share or disclose information about you, such as when they share, share a photo, or tag you in a photo.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Your privacy settings control who can tag you in a photo. Advertising partners and affiliates can share information with us such as a browser cookie ID, mobile device ID, or cryptographic hash of a shared account ID (such as an email address), as well as demographics, interests, content displayed, or actions taken on a website or app.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Our advertising partners, especially our advertisers, allow us to collect similar information directly from their website or application by integrating advertising technology.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Exchange of information and disclosure</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We do not disclose your personal information except in the limited circumstances described here.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>User consent or routing: </strong>We may share or disclose your information towards you, such as when you authorize a web (or user) or a third-party web app to access your account or when we direct you to share your feedback with a business.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>When you use Apps (Free Dentist) to register or sign in to a third-party application, you share your contact information, such as your phone number, with this app.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>If you have shared information, such as direct or protected messages, with another user by accessing (free dentist) programs through a third-party service, keep in mind that information can be shared with the third-party service.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Service Providers: </strong>We involve service providers to perform functions and provide services to us in several countries. For example, we use a variety of third-party services to help provide our services, such as hosting our various blogs and wiki pages, and helping us understand and improve the use of our services, such as Google Analytics.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We may share your information Your personal privacy with service providers subject to obligations consistent with this Privacy Policy and any other appropriate confidentiality and security measures.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>We share your payment information with payment service providers to process payments prevent, detect and investigate fraud or other prohibited activities facilitate dispute resolution such as chargebacks or refunds and for other purposes associated with accepting credit or debit cards.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Business Transactions:</strong> If you make payment as part of a business transaction through our services, we may provide the seller, trade provider, market or charity with your name, e-mail address, shipping address, payment information and transaction information to facilitate payment processing, fill out order details, and resolve disputes (including Disputes relating to payment and shipment (and assistance in preventing, detecting and investigating fraud or other prohibited activities.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Please refer to these third party privacy policies for information on privacy practices.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Law and Damage: </strong>Notwithstanding anything that conflicts with this Privacy Policy, we may maintain or disclose your information if we believe it is reasonably necessary to comply with a law, regulation, legal process or government request to protect the safety of any person to address fraud or security issues or technical matters; or to protect our rights or the rights of our users or property.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>However, there is nothing in this privacy policy designed to limit any legal defenses or objections you may have to a third party, including the government, and request disclosure of your information.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Business Transfers and Subsidiaries:</strong> In the event of bankruptcy, merger, acquisition, reorganization or sale of assets, your information may be sold or transferred as part of that transaction.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>This privacy policy will apply to your information as being transferred to the new entity. We may also disclose information about you to our affiliates to help provide, understand, improve and improve our services, including our advertising.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Public or non-personal information:</strong> We may share or disclose your public, aggregated, or non-personal information, such as public user profile information, public messages, people you follow or follow, and how often people interact with a message (e.g. number of users Who clicked on a particular link or voted on a survey in a message, even if they only did so, (or displayed reports to advertisers about unique users who viewed or clicked on their ads after they were removed and any personal information (such as your name or contact information). Other information, such as your name, user name, it is always public in the service) Free dentist</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Access and edit your personal information</p>\r\n\r\n<p>If you are a registered user of our services, we provide you with the tools and account settings to access, correct, delete, or modify the personal information you have provided to us associated with your account.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Keep in mind that search engines and other third parties may keep copies of your public information, such as user profile information and public messages.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Our global operations</strong></p>\r\n\r\n<p>As described in this Privacy Policy, we may share information with our affiliates and third parties, and you may be required to disclose information in response to acceptable government requests, including under applicable law enforcement or national security requirements.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Changes to this policy</strong></p>\r\n\r\n<p>We may review this Privacy Policy from time to time. The latest version of the Policy governing our use of your information will always be on the Free Dentist website under the Privacy / Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>By continuing to access or use the Services after these changes become effective, you agree to be bound by the revised Privacy Policy.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Terminology</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Software / Program / Application: The term &ldquo;software&rdquo; used in this document is used to refer to the original software and the full or partial copies of the software / application / website / electronic service.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>The software consists of readable instructions for the computer, software components, data, audiovisual content (such as images, text and recordings) and all software-related materials.</p>\r\n\r\n<p><strong>Device / computer:</strong> An electronic device, such as a computer / mobile / tablet / server / virtual computer / storage device.</p>\r\n', 2, '1552317904.png', 11, '2019-03-11 13:25:04', '2019-10-07 06:10:30'),
(3, 'الرسالة', 'Message', 'هذا النص هو مثال لنص يمكن أن يستبدل في نفس المساحة، لقد تم توليد هذا \r\nالنص من مولد النص العربى، حيث يمكنك أن تولد مثل هذا النص أو العديد من \r\nالنصوص الأخرى إضافة إلى زيادة عدد الحروف التى يولدها التطبيق.<br class=\"line-break\">\r\n إذا كنت تحتاج إلى عدد أكبر من الفقرات يتيح لك مولد النص العربى زيادة \r\nعدد الفقرات كما تريد، النص لن يبدو مقسما ولا يحوي أخطاء لغوية، مولد النص\r\n العربى مفيد لمصممي المواقع على وجه الخصوص، حيث يحتاج العميل فى كثير من \r\nالأحيان أن يطلع على صورة حقيقية لتصميم الموقع.', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and \r\ntypesetting industry. Lorem Ipsum has been the industry\'s standard dummy\r\n text ever since the 1500s, when an unknown printer took a galley of \r\ntype and scrambled it to make a type specimen book. It has survived not \r\nonly five centuries, but also the leap into electronic typesetting, \r\nremaining essentially unchanged. It was popularised in the 1960s with \r\nthe release of Letraset sheets containing Lorem Ipsum passages, and more\r\n recently with desktop publishing software like Aldus PageMaker \r\nincluding versions of Lorem Ipsum.</p>', 3, '1552318018.png', 11, '2019-03-11 13:26:58', '2019-03-11 13:26:58'),
(4, 'الأهداف', 'Goals', '<p>هذا النص هو مثال لنص يمكن أن يستبدل في نفس المساحة، لقد تم توليد هذا \r\nالنص من مولد النص العربى، حيث يمكنك أن تولد مثل هذا النص أو العديد من \r\nالنصوص الأخرى إضافة إلى زيادة عدد الحروف التى يولدها التطبيق.<br class=\"line-break\">\r\n إذا كنت تحتاج إلى عدد أكبر من الفقرات يتيح لك مولد النص العربى زيادة \r\nعدد الفقرات كما تريد، النص لن يبدو مقسما ولا يحوي أخطاء لغوية، مولد النص\r\n العربى مفيد لمصممي المواقع على وجه الخصوص، حيث يحتاج العميل فى كثير من \r\nالأحيان أن يطلع على صورة حقيقية لتصميم الموقع.</p>', '<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and \r\ntypesetting industry. Lorem Ipsum has been the industry\'s standard dummy\r\n text ever since the 1500s, when an unknown printer took a galley of \r\ntype and scrambled it to make a type specimen book. It has survived not \r\nonly five centuries, but also the leap into electronic typesetting, \r\nremaining essentially unchanged. It was popularised in the 1960s with \r\nthe release of Letraset sheets containing Lorem Ipsum passages, and more\r\n recently with desktop publishing software like Aldus PageMaker \r\nincluding versions of Lorem Ipsum.</p>', 4, '1552318072.png', 11, '2019-03-11 13:27:52', '2019-03-11 13:27:52');
INSERT INTO `pages` (`page_id`, `page_name_ar`, `page_name_en`, `page_desc_ar`, `page_desc_en`, `page_order`, `page_photo`, `created_by`, `created_at`, `updated_at`) VALUES
(5, 'ff', 's', 'هذا النص هو مثال لنص يمكن أن يستبدل في نفس المساحة، لقد تم توليد هذا النص من مولد النص العربى، حيث يمكنك أن تولد مثل هذا النص أو العديد من النصوص الأخرى إضافة إلى زيادة عدد الحروف التى يولدها التطبيق. إذا كنت تحتاج إلى عدد أكبر من الفقرات يتيح لك مولد النص العربى زيادة عدد الفقرات كما تريد، النص لن يبدو مقسما ولا يحوي أخطاء لغوية، مولد النص العربى مفيد لمصممي المواقع على وجه الخصوص، حيث يحتاج العميل فى كثير من الأحيان أن يطلع على صورة حقيقية لتصميم الموقع.', '<p dir=\"RTL\"><strong>سياسة الخصوصية</strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">هي منصة تمكن المرضى من جميع الجنسيات لتلقي خدمة طبيب اسنان مجاني لدى الأطباء المتدربين الجامعيين في مستشفيات الاسنان الجامعية &nbsp;</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">تصف سياسة الخصوصية هذه، كيفية ومتى نجمع معلوماتك ونستخدمها ونشاركها عبر برامجنا/مواقعنا الإلكترونية والرسائل القصيرة وواجهات برمجة التطبيقات وإشعارات البريد الإلكتروني والتطبيقات والبرامج والأزرار والإعلانات وخدمات التجارة والخدمات الأخرى التي يتم تغطيتها والتي ترتبط بهذه السياسة ) وبشكل عام نسميها،</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">&quot;الخدمات&quot;(، ومن شركائنا وأطراف أخرى. على سبيل المثال ،ترسل إلينا معلومات عند استخدام خدماتنا على الويب أو عبر الرسائل القصيرة أو من برنامج/تطبيق أنشأناه على الأجهزة. عند استخدام أي من خدماتنا، فإنك توافق على جمع معلوماتك ونقلها وتخزينها والإفصاح عنها واستخدامها كما هو موضح في سياسة الخصوصية هذه. ويشمل ذلك أي معلومات تختار تقديمها تعتبر حساسة بموجب القانون المعمول به.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:21.6pt\">عندما تشير هذه السياسة &quot;نحن&quot; أو &quot;لنا&quot;، فإنه يشير إلى وحدة تحكم المعلومات الخاصة بك بموجب هذه السياسة. يتم التحكم في المعلومات الخاصة بك من قبل )طبيب أسنان مجاني(. وعلى الرغم من ذلك، فإنك وحدك تتحكم في نشر المحتوى الذي تقدمه من خلال الخدمات، كما هو منصوص عليه في بنود الخدمة وقواعد )طبيب أسنان مجاني(.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:12.4pt\">وبغض النظر عن البلد الذي تعيش فيه، فإنك تفوضنا بنقل وتخزين واستخدام المعلومات الخاصة بك في أي بلد نعمل فيه. وفي بعض هذه البلدان، قد تختلف قوانين وقواعد حماية الخصوصية والبيانات المتعلقة بوقت وصول السلطات الحكومية إلى البيانات عن تلك الموجودة في البلد الذي تعيش فيه.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">إذا كان لديك أي أسئلة أو تعليقات حول سياسة الخصوصية هذه، يرجى تقديم طلب من خلال نموذج لدينا، وهي متاحة في مواقع/برامج )طبيب أسنان مجاني(.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>جمع المعلومات واستخدامها</strong></p>\r\n\r\n<p dir=\"RTL\">نجمع معلوماتك ونستخدمها لتقديم خدماتنا وفهمها وتحسينها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">معلومات الحساب الأساسية: إذا اخترت إنشاء حساب عند )طبيب أسنان مجاني(، يجب أن تقدم لنا بعض المعلومات الشخصية، مثل اسمك أو اسم المستخدم أو كلمة المرور أو عنوان البريد الإلكتروني أو رقم الهاتف. على تطبيق/برنامج )طبيب أسنان مجاني(، يتم سرد اسمك واسم المستخدم علنا، بما في ذلك على صفحة ملفك الشخصي وفي نتائج البحث ،ويمكنك استخدام إما اسمك الحقيقي أو اسم مستعار. يمكنك إنشاء وإدارة حسابات متعددة عند )طبيب أسنان مجاني(. إذا كنت تستخدم تطبيقات )طبيب أسنان مجاني(، فمعلومات الاتصال بك والتي تقدمها لتسجيل الدخول ليست عامة للناس بل مخصصة للمرضى و الأطباء فيمابينهم المستفيدين من الخدمة. بعض من ميزات منتجاتنا، مثل البحث وعرض ملامح المستخدمين العامة أو مشاهدة البث على خدمات )طبيب أسنان مجاني(، والتي لا تتطلب منك إنشاء حساب.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:8.6pt\"><strong>معلومات الاتصال</strong>: يمكنك استخدام معلومات الاتصال الخاصة بك، مثل عنوان البريد الإلكتروني أو رقم الهاتف وغيرها، لتخصيص حسابك أو تمكين ميزات حساب معينة ،على سبيل المثال، للتحقق من تسجيل الدخول أو تطبيقات )طبيب أسنان مجاني( عبر الرسائل القصيرة او ما سواها. إذا قمت بتزويدنا برقم هاتفك، فإنك توافق على تلقي رسائل نصية إلى هذا الرقم منا. يجوز لنا استخدام معلومات الاتصال الخاصة بك لإرسال معلومات عن خدماتنا أو تسويقها أو المساعدة على منع الرسائل غير المرغوب فيها أو الاحتيال أو إساءة الاستخدام ومساعدة الآخرين في العثور على حسابك، بما في ذلك من خلال خدمات الجهات الخارجية وتطبيقات (المستخدم). يمكنك استخدام الإعدادات المتوفرة للتحكم في الإشعارات التي تتلقاها من تطبيقات )طبيب أسنان مجاني(. إعدادات الخصوصية الخاصة بك تتحكم ما إذا كان الآخرون يمكن أن يجدوك على تطبيقات )طبيب أسنان مجاني( عن طريق عنوان البريد الإلكتروني الخاص بك أو رقم الهاتف أو غيرها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:12.8pt\"><strong>معلومات إضافية</strong>: إذا راسلتنا عبر البريد الإلكتروني، قد نحتفظ برسالتك وعنوان البريد الإلكتروني ومعلومات الاتصال للرد على طلبك. إذا ربطت حسابك على خدماتنا إلى حسابك على خدمة أخرى من أجل المشاركة بين خدماتنا وهذه الخدمة، قد ترسل خدمة أخرى لنا تسجيل أو تعريف المعلومات الخاصة بك على هذه الخدمة وغيرها من المعلومات التي لديك صرحت لها. وتمكن هذه المعلومات من النشر بينها، وتساعدنا في تحسين الخدمات، وقد نحتفظ بها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:6.2pt\"><strong>الرسائل ،المتابعات، القوائم، الملف الشخصي، وغيرها من المعلومات العامة</strong>: معظم المعلومات التي تقدمها لنا من خلال خدمات )طبيب أسنان مجاني( هي المعلومات التي تطلب منا أن تكون معلونة للجمهور. يمكنك تزويدنا بالمعلومات الشخصية لجعل الجمهور على خدمات )طبيب أسنان مجاني(، مثل سيرة قصيرة، موقعك، موقع الويب الخاص بك، وتاريخ الميلاد، أو صورة. بالإضافة إلى ذلك، تتضمن معلوماتك العامة الرسائل التي ترسلها؛ البيانات الوصفية المقدمة معهم، مثل عند إرسال وتطبيق (المستخدم) الذي اعتدت إرساله؛ معلومات عن حسابك، مثل وقت الإنشاء واللغة والبلد والمنطقة الزمنية؛ والقوائم التي تنشئها، والأشخاص الذين تتابعهم. يقوم )طبيب أسنان مجاني( على نطاق واسع وعلى الفور نشر المعلومات العامة لمجموعة واسعة من المستخدمين والعملاء، والخدمات، بما في ذلك محركات البحث والمطورين والناشرين التي تعمل على دمج محتوى )طبيب أسنان مجاني( إلى خدماتهم ،ومنظمات مثل الجامعات، ووكالات الصحة العامة، وشركات أبحاث السوق التي تحلل المعلومات عن الاتجاهات والرؤى. عند مشاركة معلومات أو محتوى مثل الصور ومقاطع الفيديو والروابط عبر الخدمات، يجب أن تفكر مليا في ما تعلنه بشكل عام. قد نستخدم هذه المعلومات لإجراء استدلالات، مثل الموضوعات التي قد تكون مهتم بها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:10.6pt\"><strong>الرسائل المباشرة والاتصالات غير العامة</strong>: نقدم بعض الميزات التي تتيح لك التواصل بشكل أكثر خصوصية. على سبيل المثال، يمكنك استخدام الرسائل المباشرة لإجراء محادثات خاصة مع مستخدمي برامج )طبيب أسنان مجاني( الآخرين. عند التواصل بشكل خاص مع الآخرين من خلال خدماتنا، مثل إرسال الرسائل المباشرة واستلامها، سنقوم بتخزين ومعالجة اتصالاتك والمعلومات المتعلقة بها. يرجى ملاحظة أنه إذا كنت تتفاعل مع محتوى )طبيب أسنان مجاني( العامة المشتركة معك عبر رسالة مباشرة، على سبيل المثال عند عمل لايك على رسالة مشتركة عبر رسالة مباشرة، تلك التفاعلات قد تكون عامة. في حين أن ميزات مثل الرسائل المباشرة يقصد بها أن تكون خاصة، يرجى تذكر أن المستلمين قد ينسخ ويخزن ويعيد مشاركة محتويات الاتصالات الخاصة بك.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:13.8pt\"><strong>معلومات الموقع:</strong> قد نتلقى معلومات حول موقعك. على سبيل المثال، يمكنك اختيار نشر موقعك في رسائلك وفي ملفك الشخصي )طبيب أسنان مجاني(. قد تخبرنا أيضا موقعك عند تعيين موقع الاتجاه الخاص بك على برامج )طبيب أسنان مجاني(. وقد نحدد أيضا الموقع باستخدام بيانات أخرى من جهازك، مثل معلومات الموقع الدقيقة من نظام تحديد المواقع العالمي )<span dir=\"LTR\">GPS</span>(، ومعلومات عن الشبكات اللاسلكية أو أبراج الجوال بالقرب من جهازك الجوال، أو عنوان الشبكة الخاص بك. يجوز لنا استخدام معلومات حول موقعك وتخزينها لتوفير ميزات خاصة في خدماتنا، مثل المراسلة مع موقعك، وتحسين الخدمات وتخصيصها، على سبيل المثال، بمحتوى أكثر ملاءمة مثل الاتجاهات والقصص والإعلانات والاقتراحات المحلية للأشخاص.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>الروابط:</strong> يجوز لنا تتبع كيفية تفاعلك مع الروابط عبر خدماتنا، بما في ذلك إشعارات البريد الإلكتروني وخدمات الجهات الخارجية وتطبيقات (المستخدم)، وذلك عن طريق إعادة توجيه النقرات أو من خلال وسائل أخرى. ونحن نفعل ذلك للمساعدة في تحسين خدماتنا، وتقديم إعلانات أكثر ملاءمة، ولنتمكن من مشاركة إحصاءات النقرات المجمعة مثل عدد المرات التي تم فيها النقر على رابط معين. ستتم معالجة الروابط والرسائل والاتصالات غير العامة مثل الرسائل المباشرة المشتركة على الخدمات وتقصير الروابط إلى عنوان قصير عن طريق خدمة تقصير الروابط.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>ملفات تعريف الارتباط </strong><strong><span dir=\"LTR\">Cookies</span></strong><strong>:</strong> تستخدم العديد من مواقع الويب والبرامج ملفات تعريف الارتباط والتقنيات المشابهة لجمع بيانات إضافية عن استخدام مواقع الويب</p>\r\n\r\n<p dir=\"RTL\">وتحسين خدماتنا. ملف تعريف الارتباط هو ملف بيانات صغير يتم نقله إلى جهازك. يجوز لنا استخدام ملفات تعريف الارتباط للجلسات وملفات تعريف الارتباط الدائمة لفهم كيفية تفاعلك مع خدماتنا بشكل أفضل، ومراقبة الاستخدام الإجمالي من قبل المستخدمين وتوجيه حركة المرور على الويب على خدماتنا، ولتخصيص خدماتنا وتحسينها. على الرغم من أن معظم متصفحات الويب تقبل ملفات تعريف الارتباط تلقائيا، يمكن تعديل بعض إعدادات المتصفحات لرفض ملفات تعريف الارتباط أو تنبيهك عندما يحاول موقع ويب وضع ملف تعريف ارتباط على جهاز الكمبيوتر الخاص بك. ومع ذلك، قد لا تعمل بعض الخدمات بشكل صحيح إذا قمت بتعطيل ملفات تعريف الارتباط.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>استخدام خدماتنا:</strong> نتلقى معلومات منك/عنك عند التفاعل مع خدماتنا، حتى إذا لم تكن قد أنشأت حسابا )&quot;بيانات السجل&quot;(. على سبيل المثال، عند زيارة مواقعنا الإلكترونية أو تسجيل الدخول إلى خدماتنا أو التفاعل مع إشعارات البريد الإلكتروني أو استخدام حسابك للمصادقة على موقع ويب أو تطبيق أو خدمة تابعة لجهة خارجية أو زيارة موقع ويب أو تطبيق أو خدمة تابعة لجهة خارجية يتضمن تطبيقات )طبيب أسنان مجاني( زر أو أمر، فقد تتلقى معلومات عنك. قد تتضمن بيانات السجل هذه عنوان الشبكة أو نوع المتصفح أو نظام التشغيل أو صفحة الويب المحالة أو الصفحات التي تمت زيارتها أو الموقع أو مشغل شبكة الجوال أو معلومات الجهاز )بما في ذلك أرقام تعريف الجهاز والتطبيق( أو عبارات البحث أو معلومات ملفات تعريف الارتباط. كما نتلقى بيانات السجل عند النقر على عرض شيء أو التفاعل مع الروابط على خدماتنا، بما في ذلك وصلات إلى تطبيقات الطرف الثالث، مثل عند اختيار تثبيت تطبيق آخر من خلال تطبيقات )طبيب أسنان مجاني( / الشبكات. نستخدم بيانات السجل لإجراء استدلالات، مثل الموضوعات التي قد تكون مهتما بها، وتخصيص المحتوى الذي نعرضه لك، بما في ذلك الإعلانات. نحن نحافظ على بيانات السجل حسب الحاجة للأغراض الموضحة في سياسة الخصوصية هذه.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>بيانات القطعة </strong><strong><span dir=\"LTR\">Widget</span></strong><strong>:</strong> يمكننا تخصيص الخدمات لك استنادا إلى زياراتك إلى مواقع ويب تابعة لجهات خارجية والتي تدمج أزرار برامج )طبيب أسنان مجاني( أو الأدوات.</p>\r\n\r\n<p dir=\"RTL\">عندما تقوم هذه المواقع أولا بتحميل أزرارنا أو أدواتنا للعرض، نتلقى بيانات السجل التي تتضمن صفحة الويب التي زرتها وملف تعريف الارتباط الذي يعرف متصفحك</p>\r\n\r\n<p dir=\"RTL\">)&quot;بيانات القطعة&quot;(.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:21.8pt\"><strong>خدمات التجارة:</strong> يمكنك تقديم معلومات الدفع، بما في ذلك رقم بطاقة الائتمان أو الخصم، وتاريخ انتهاء صلاحية البطاقة، ورمز السري، وأنواع الدفع الأخرى، وعنوان إرسال الفواتير )يشار إليه معا باسم &quot;معلومات الدفع&quot;(، إلى جانب عنوان الشحن، لإكمالها من خلال خدماتنا. لتسهيل عمليات الشراء المستقبلية، نخزن معلومات الدفع</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:11.4pt\">)باستثناء رمز السري للبطاقة( وعنوان الشحن. نحن نعتبر معلومات الدفع وعنوان الشحن خاصة ولا نجعل هذه المعلومات عامة. لتسهيل تنفيذ الطلب، نقوم بجمع وتخزين المعلومات التي تم إنشاؤها بواسطة عمليات الشراء التي تتم من خلال خدماتنا )&quot;بيانات المعاملة&quot;(. قد تتضمن بيانات المعاملة اسم التاجر وتاريخ ووقت وقيمة المعاملة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:7.4pt\"><strong>الإعلان:</strong> خدماتنا مدعومة بالإعلانات. يجوز لنا استخدام المعلومات الموضحة في سياسة الخصوصية هذه للمساعدة في جعل إعلاناتنا أكثر ملاءمة لك ولقياس فعاليتها وللمساعدة في التعرف على أجهزتك لعرض إعلاناتك على برامج )طبيب أسنان مجاني( وإيقافها. على سبيل المثال، عند التفاعل مع المحتوى في تطبيق )طبيب أسنان مجاني( لأجهزة ما، قد نعرض محتوى )بما في ذلك الإعلانات( حول تلك المواضيع نفسها عند استخدام )طبيب أسنان مجاني( على الويب. نحن لا نستخدم المحتوى الذي تشاركه بشكل خاص في الرسائل المباشرة لعرض إعلاناتك. كما تحظر سياسة إعلانات )طبيب أسنان مجاني( على المعلنين استهداف الإعلانات استنادا إلى فئات نعتبرها حساسة، مثل العرق أو الدين أو السياسة أو الحياة الجنسية أو الصحة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>الأطراف الثالثة والشركات التابعة:</strong> قد نتلقى معلومات عنك من جهات خارجية، مثل مستخدمي )طبيب أسنان مجاني( الآخرين، والشركاء )بما في ذلك الشركاء في الإعلانات(، أو الشركات التابعة لنا. على سبيل المثال، قد يشارك المستخدمون الآخرون معلومات عنك أو يكشفونها، مثل عندما يشاركونك أو يشاركون صورة لك أو يضعون علامة باسمك في صورة. تتحكم إعدادات الخصوصية في تحديد الأشخاص الذين يمكنهم وضع علامة باسمك في إحدى الصور. يمكن لشركاء الإعلانات والشركات التابعة لنا مشاركة المعلومات معنا مثل معرف ملف تعريف ارتباط المتصفح أو معرف جهاز الجوال أو تجزئة التشفير لمعرف حساب مشترك )مثل عنوان البريد الإلكتروني(، فضلا عن البيانات السكانية أو الاهتمامات والمحتوى المعروض أو الإجراءات المتخذة على موقع ويب أو تطبيق. قد يسمح لنا شركاؤنا في الإعلانات، ولا سيما معلنينا، بجمع معلومات مماثلة مباشرة من موقعهم الإلكتروني أو تطبيقهم من خلال دمج تقنية الإعلانات.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>تبادل المعلومات والإفصاح عنها</strong></p>\r\n\r\n<p dir=\"RTL\">نحن لا تكشف عن المعلومات الشخصية الخاصة بك إلا في ظروف محدودة وصفها هنا.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:6.0pt\"><strong>موافقة المستخدم أو توجيهه:</strong> يجوز لنا مشاركة معلوماتك أو الإفصاح عنها في اتجاهك، مثل عند تفويض (مستخدم) ويب أو تطبيق ويب تابع لجهة خارجية للدخول إلى حسابك أو عند توجيهنا لمشاركة تعليقاتك مع نشاط تجاري. عند استخدام تطبيقات )طبيب أسنان مجاني( للتسجيل أو تسجيل الدخول إلى تطبيق طرف ثالث ،كتبادل معلومات الاتصال الخاصة بك، مثل رقم الهاتف الخاص بك، مع هذا التطبيق. إذا كنت قد شاركت المعلومات، مثل الرسائل المباشرة أو الرسائل المحمية، مع مستخدم آخر يقوم بالوصول إلى برامج )طبيب أسنان مجاني( من خلال خدمة من جهة خارجية، ضع في اعتبارك أنه يمكن مشاركة المعلومات مع خدمة الجهات الخارجية.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>مقدمي الخدمات:</strong> نشرك مقدمي الخدمات لأداء وظائف وتقديم الخدمات لنا في عدة بلدان. على سبيل المثال، نستخدم مجموعة متنوعة من خدمات الجهات الخارجية للمساعدة في توفير خدماتنا، مثل استضافة مدوناتنا المختلفة وصفحات ويكي، ومساعدتنا على فهم استخدام خدماتنا وتحسينها، مثل غوغل أناليتيكش. يجوز لنا مشاركة معلوماتك</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">الشخصية الخاصة مع مقدمي الخدمات الخاضعين لالتزامات تتفق مع سياسة الخصوصية هذه وأي تدابير سرية وأمنية أخرى مناسبة. نحن نشارك معلومات الدفع الخاصة بك مع مقدمي خدمات الدفع لمعالجة المدفوعات؛ منع وكشف والتحقيق في حالات الغش أو غيرها من الأنشطة المحظورة؛ تسهيل تسوية المنازعات مثل عمليات رد المبالغ المدفوعة أو رد الأموال؛ ولأغراض أخرى مرتبطة بقبول بطاقات الائتمان أو بطاقات السحب الآلي.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>المعاملات التجارية:</strong> إذا قمت بإجراء الدفع كجزء من معاملة تجارية من خلال خدماتنا، فقد نوفر للبائع أو مزود التجارة أو السوق أو المؤسسة الخيرية اسمك وعنوان البريد الإلكتروني وعنوان الشحن ومعلومات الدفع وبيانات المعاملات لتسهيل معالجة الدفع ، وتعبئة بيانات الطلب، وتسوية المنازعات )بما في ذلك المنازعات المتعلقة بالدفع والشحن( والمساعدة في منع الغش أو غيره من الأنشطة المحظورة والكشف عنها والتحقيق فيها. يرجى الرجوع إلى سياسات خصوصية هذه الجهات الخارجية للحصول على معلومات حول ممارسات الخصوصية.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>القانون والضرر:</strong> بغض النظر عن أي شيء يتعارض مع سياسة الخصوصية هذه، يجوز لنا الحفاظ على معلوماتك أو الإفصاح عنها إذا رأينا أن من الضروري بشكل معقول الامتثال لقانون أو لائحة أو إجراءات قانونية أو طلب حكومي؛ لحماية سلامة أي شخص؛ لمعالجة قضايا الاحتيال أو الأمن أو المسائل التقنية؛ أو لحماية حقوقنا أو حقوق مستخدمينا أو ممتلكاتنا. ومع ذلك، لا يوجد شيء في سياسة الخصوصية هذه يهدف إلى الحد من أي دفاعات قانونية أو اعتراضات قد تكون لديك لطرف ثالث، بما في ذلك الحكومة، وطلب الكشف عن المعلومات الخاصة بك.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>تحويلات الأعمال والشركات التابعة:</strong> في حال وقوعنا في حالة إفلاس أو اندماج أو اقتناء أو إعادة تنظيم أو بيع أصول، قد يتم بيع معلوماتك أو نقلها كجزء من تلك المعاملة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:19.8pt\">وستسري سياسة الخصوصية هذه على معلوماتك على أنها نقلت إلى الكيان الجديد. وقد نكشف أيضا معلومات عنك إلى الشركات التابعة لنا للمساعدة في توفير الخدمات وفهمها وخدماتنا التابعة لنا وفهمها وتحسينها، بما في ذلك تقديم الإعلانات.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\"><strong>المعلومات العامة أو غير الشخصية:</strong> يجوز لنا مشاركة معلوماتك العامة أو المجمعة أو غير الشخصية أو الكشف عنها، مثل معلومات الملف الشخصي للمستخدم العام ،والرسائل العامة، والأشخاص الذين تتابعهم أو الذين يتبعونك، وعدد مرات تفاعل الأشخاص مع رسالة )على سبيل المثال، عدد المستخدمين الذين نقروا على رابط معين أو صوتوا على استطلاع للرأي في إحدى الرسائل، حتى لو لم يفعلوا ذلك سوى(، أو عرض تقارير على المعلنين حول المستخدمين الفريدين الذين شاهدوا إعلاناتهم أو نقروا عليها بعد إزالتها وأي معلومات شخصية خاصة )مثل اسمك أو معلومات الاتصال(. معلومات أخرى، مثل اسمك واسم المستخدم، هو دائما عام على خدمات )طبيب أسنان مجاني(.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>الوصول إلى معلوماتك الشخصية وتعديلها</strong></p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:7.0pt\">إذا كنت مستخدما مسجلا لخدماتنا، فإننا نوفر لك الأدوات وإعدادات الحساب للدخول إلى المعلومات الشخصية التي قدمتها إلينا والمرتبطة بحسابك أو تصحيحها أو حذفها أو تعديلها.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">ضع في اعتبارك أن محركات البحث والأطراف الثالثة الأخرى قد تحتفظ بنسخ من معلوماتك العامة، مثل معلومات الملف الشخصي للمستخدم والرسائل العامة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>عملياتنا العالمية</strong></p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">وكما هو موضح في سياسة الخصوصية هذه، يجوز لنا مشاركة المعلومات مع الشركات التابعة لنا والجهات الخارجية، وقد يطلب منك الكشف عن المعلومات استجابة لطلبات حكومية مقبولة، بما في ذلك بموجب متطلبات إنفاذ القانون أو متطلبات الأمن القومي المعمول بها.&nbsp;</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:5.2pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>تغييرات على هذه السياسة</strong></p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:14.6pt\">يجوز لنا مراجعة سياسة الخصوصية هذه من وقت لآخر. أحدث إصدار من السياسة تحكم استخدامنا للمعلومات الخاصة بك ستكون دائما في موقع&nbsp; )طبيب أسنان مجاني( تحت عنوان الخصوصية/سياسة الخصوصية. من خلال الاستمرار في الوصول إلى الخدمات أو استخدامها بعد أن تصبح هذه التغييرات فعالة، فإنك توافق على الالتزام بسياسة الخصوصية المنقحة.</p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:1.65pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong>المصطلحات </strong></p>\r\n\r\n<p dir=\"RTL\" style=\"margin-left:-.55pt\"><strong>برنامج/البرنامج/تطبيق:</strong> يستخدم مصطلح &quot;<strong>البرنامج</strong>&quot; الوارد في هذه الوثيقة للإشارة إلى البرنامج الأصلي والنسخ الكاملة أو الجزئية من البرنامج/التطبيق/الموقع الالكتروني/الخدمة الالكترونية. ويتكون البرنامج من تعليمات مقروءة للحاسب ومكونات البرنامج والبيانات والمحتوى السمعي-البصري )مثل الصور والنصوص والتسجيلات( وكل ما يتعلق بالبرنامج من المواد المرخصة.</p>\r\n\r\n<p><strong><span dir=\"RTL\">جهاز/حاسب:</span></strong><span dir=\"RTL\"> جهاز الكتروني، مثل حاسب آلي/جوال/تابلت/خادم/حاسب افتراضي/جهاز تخزين</span></p>\r\n', 5, NULL, NULL, '2019-06-03 09:38:56', '2019-10-06 09:49:51'),
(7, 'الشروط والاحكام ', 'Terms and conditions\r\n', '<p dir=\"RTL\"><strong>الشروط والأحكام</strong></p>\r\n\r\n<p dir=\"RTL\"><strong><u>مقدمة</u></strong><strong><u><span dir=\"LTR\">:</span></u></strong></p>\r\n\r\n<p dir=\"RTL\">هذه الاتفاقية هي عقد مبرم بين طبيب أسنان مجاني ومن يستخدم موقعها الإلكتروني على شبكة الإنترنت أو تطبيقات الهواتف الذكية سواء كان المستخدم مسجلاً أم لا، وبموافقة المستخدم على شروط الموقع يمكنه الدخول إليه واستخدامه حسب شروط الاتفاقية. وتعتبر هذه المقدمة جزءاً من هذه الاتفاقية والشروط هي<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\"><strong><u>شروط الاستخدام</u></strong><strong><u><span dir=\"LTR\">:</span></u></strong></p>\r\n\r\n<p dir=\"RTL\">طبيب أسنان مجاني يخلي المسؤولية بأي حال من الأحوال الأضرار العرضية أو المباشرة أو غير المباشرة أو الخاصة أو العقابية أو النموذجية أو الناشئة، والتي قد تبرز نتيجة لاستخدامك أو عدم قدرتك على استخدام الموقع. وبمجرد استخدامك للموقع فانت توافق على<span dir=\"LTR\">:</span> الشروط والاحكام.</p>\r\n\r\n<p dir=\"RTL\">1- إن سرية المعلومات المعطاة والمقدمة بموجب هذا النظام هي من مسؤولية المشترك (المستخدم) وحده<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">2- إن المشترك (المستخدم) بمجرد استخدامه لهذا النظام يتنازل وبشكل مسبق ولا يقبل النقض عن أي شكاوى أو دعاوى أو مطالبات ناجمة عن استخدام موقع طبيب أسنان مجاني وتطبيق الجوال.</p>\r\n\r\n<p dir=\"RTL\">3- إن موقع وتطبيق طبيب أسنان مجاني غير مسؤولة عن أي تأخير أو تردي في جودة الخدمة أو سوء أداء أو انقطاع في الخدمة لأي سبب كان، ويسقط المشترك (المستخدم) أي مطالبة له ضد طبيب أسنان مجاني بهذا الخصوص<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">4- أن يتعهد المشترك (المستخدم) بعدم إساءة استخدام البرنامج وعليه يتحمل وحده المسئولية لسوء استخدام البرنامج<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">5- المام (المشترك) المستخدم بالإجراءات والانظمة واللوائح للخدمة بشكلها الاعتيادي والتزامه بعدم مخالفة هذه الاجراءات والعمل على استيفاء متطلبات تقديم الخدمة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong><u>الاستخدام</u></strong><strong><u><span dir=\"LTR\">:</span></u></strong></p>\r\n\r\n<p dir=\"RTL\">أنت توافق على دخول واستخدام الموقع لأغراض مشروعة فقط، وعلى علم كامل بكل القوانين والأنظمة والقواعد والأحكام والشروط المتعلقة باستخدامك للموقع وتطبيق الجوال، وبمجرد دخولك إلى الموقع فإنك توافق على الامتناع عن<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\">1- استخدام الموقع من أجل ارتكاب جريمة أو تشجيع الآخرين على التورط في أي تصرف قد يعد جريمة أو ينطوي على مسؤولية مدنية<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">2- إدخال أو نشر أي محتويات غير قانونية تتضمن تمييزاً أو تشهيراً أو إساءة أو قذف أو فاحشة ضد أي جهة كانت أو مواد إباحية<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">3- استخدام الموقع من أجل انتحال شخصيات أو أطراف أخرى<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">4- استخدام الموقع لتحميل أي مادة فيها برامج تحتوي على فيروسات أو ملفات تجسس أو أي شفرات حاسوبية أو ملفات أو برامج قد تعمل على تغيير أو إتلاف أو إعاقة عمل الموقع أو أي جهاز أو برنامج عائد إلى أي شخص يدخل إلى الموقع<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">5- تحميل أو إدخال أو إرسال أو بث لأي مواد لا يحق لك بثها بموجب أي قانون أو علاقة تعاقدية<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">6- تغيير أو إتلاف أو شطب أي محتوى على الموقع<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">7- تعطيل خطوط الاتصال الاعتيادية بأي شكل كان<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">8- الادعاء بالارتباط مع أو تمثيل أي شركة أو جمعية أو هيئة من دون أن تكون مخولاً بادعاء تلك العلاقة أو ذلك التمثيل<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">9- نشر أو بث أي إعلان أو مادة دعائية أو أي شكل من أشكال الترويج دون اتفاقية مسبقة<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">10- نشر أي مادة تتنافى أو تتعارض مع حقوق الملكية الفكرية للآخرين<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">11- جمع أو تخزين المعلومات الشخصية عن الآخرين<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong><u>تعديل الاتفاقية</u></strong><strong><u><span dir=\"LTR\">:</span></u></strong></p>\r\n\r\n<p dir=\"RTL\">يحق لطبيب أسنان مجاني تعديل هذه الشروط والأحكام على أن يتم وضع إشعار بحدوث تعديلات على هذه الصفحة، وتدخل التعديلات حيز النفاذ بمجرد إحداثها، إن استخدامك المتكرر للموقع او تطبيقات الهواتف الذكية بعد إحداث تلك التعديلات يعني موافقتك على التعديلات، ويتعين عليك القيام بزيارات دورية لهذه الصفحة لمراجعة شروط وأحكام الاستخدام<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong><u>التسجيل</u></strong><strong><u><span dir=\"LTR\">:</span></u></strong></p>\r\n\r\n<p dir=\"RTL\">بعض أجزاء الموقع أو تطبيقات الهواتف الذكية لا تفتح إلا للأعضاء المسجلين و/أو تتيح للمستخدم طلب الدعم أو الخدمات إلكترونياً عبر إدخال المعلومات الشخصية. أنت توافق على أن أي معلومات تقدم لنا عبر تلك الأجزاء هي معلومات كاملة ودقيقة، ولن تحاول دخول الموقع مستخدماً اسم شخص آخر، ولن تتبنى اسم مستخدم قد يراه طبيب أسنان مجاني غير مناسب<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong><u>إنهاء الاستخدام</u></strong><strong><u><span dir=\"LTR\">:</span></u></strong></p>\r\n\r\n<p dir=\"RTL\">لطبيب أسنان مجاني كل الحق في إنهاء أو تعليق دخولك أو استخدامك لهذا الموقع أو تطبيقات الهواتف الذكية من دون إشعار مسبق وذلك بسبب انتهاكك لهذه الشروط أو القوانين المعمول أو بسبب أي تصرف قد يرى طبيب أسنان مجاني أنه مخالف للاتفاقيات الدولية والأعراف أو مضر بالآخرين، وفي حال الإنهاء لن يكون في إمكانك الدخول إلى الموقع أو تطبيقات الهواتف الذكية، وسوف طبيب أسنان مجاني كل وسيلة متاحة لتطبيق هذا المنع<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong><u>التعويض</u></strong><strong><u><span dir=\"LTR\">:</span></u></strong></p>\r\n\r\n<p dir=\"RTL\">أنت توافق على الدفاع عن مصالح طبيب أسنان مجاني&nbsp; لدى أي جهة رسمية أو غير رسمية بسبب أي مطالبة مالية أو غير مالية نتجت عن انتهاكك لأي شرط من شروط هذه الاتفاقية ونتيجة لذلك فإنك تتحمل كل التكاليف المالية وغير المالية التي نتجت عن انتهاكك لأي شرط من شروط هذه الاتفاقية سواء أكانت تأميناً أو تعويضاً أو رسوماً أو أي تكاليف مالية أو غير مالية أخرى، وكل تسوية تقوم بها لدى أي جهة رسمية أو غير رسمية بسبب انتهاكك لأي شرط من شروط هذه الاتفاقية لا تصبح صحيحة ونافذة المفعول إلا بموافقة طبيب أسنان مجاني الصريحة والخطية لها<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\"><strong><u>التنازل عن الضمان</u></strong><strong><u><span dir=\"LTR\">:</span></u></strong></p>\r\n\r\n<p dir=\"RTL\">أنت تفهم بوضوح وتوافق على أن استخدامك للموقع أو تطبيقات الهواتف الذكية أو أي مادة متاحة من خلاله هي خاضعة لمسؤوليتك الخاصة، ولا طبيب أسنان مجاني ولا أي من موظفيها ضمانة بأن الموقع أو تطبيقات الهواتف الذكية لن يتعرض للتوقف أو أنه سيكون خالياً من المشاكل أو الحذف أو الأخطاء، كما لا توجد ضمانة بشأن النتيجة التي ستحصل عليها جراء استخدامك للموقع او تطبيق الجوال، إن المحتويات والأدوات على الموقع مقدمة لك على حالها من دون ضمانات من أي نوع، سواء كانت صريحة أو ضمنية<span dir=\"LTR\">.</span></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong><u>إقرار</u></strong></p>\r\n\r\n<p dir=\"RTL\">إن عيادة كلية طب الأسنان في الجامعة هي عيادة تعليمية للطلبة تحت اشراف أكاديمي من (أخصائيين واستشاريين) مع العلم بأن على كافة المرضى المسجلين تلقى العلاج من قبل الطلبة.</p>\r\n\r\n<p dir=\"RTL\">حيث إن المرضى المرشحين لتلقي العلاج سوف يتم قبولهم واختيارهم من قبل الأخصائيين بعد التشخيص المبدئي (لا يشمل العلاج) للمريض.</p>\r\n\r\n<p dir=\"RTL\">إن الخدمة المقدمة قد تستوجب حضور المريض لعدة زيارات وإن مدة كل زيارة قد تتجاوز ساعتين.</p>\r\n\r\n<p dir=\"RTL\">وعلى كافة المرضى استيعاب أن فترة العلاج مرتبطة بتواجد الطلبة بالعيادة.</p>\r\n\r\n<p dir=\"RTL\">أتفهم أن تقييم الأسنان الذي سأتلقاه اليوم لا يمثل فحصًا أو فحصًا للأسنان أو رأيًا ثانيًا، وأنه ينبغي عليّ الاستمرار في رؤية طبيب أسنان للحفاظ على صحة الأسنان إلا إذا و / أو حتى أتلقى إشعارًا بأنني تم قبولي كمريض في مستشفى كلية طب الأسنان.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">أفهم أيضًا الغرض من زيارتي لمستشفى كلية طب الأسنان.</p>\r\n\r\n<p dir=\"RTL\">سيتم تقييم عيادة الأسنان لقبولي كمريض في عيادة التدريس الجامعي. إذا كان التقييم لطبيب الأسنان يشير إلى أنني لن أكون مريضًا مناسبًا، يجب أن أطلب علاج الأسنان في مكان آخر.</p>\r\n\r\n<p dir=\"RTL\">فقط إذا كان طبيب الأسنان يعتقد أن احتياجاتي في طب الأسنان قد تتناسب مع احتياجات طلاب طب الأسنان الذين يقدمون العلاج في العيادة التعليمية، قد يحيلني طبيب الأسنان إلى عيادة الأشعة الفموية للحصول على صور إشعاعية عن طريق الفم (يتم أخذ الأشعة السينية). بناءً على التقييم لطبيب الأسنان وتقييمه / تصويري لأشعة، سيتم اتخاذ قرار نهائي بشأن ما إذا كنت مريضًا مناسبًا أم لا. سيتم إخباري بهذا القرار.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong><u>معلومات عامة والموافقة</u></strong></p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">1- جامعة التدريس<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\">المستشفى في كلية طب الأسنان، هي مؤسسة تعليمية. الطلاب والمتدربين والمقيمين وغيرهم من المتخصصين في الرعاية الصحية للأسنان المتحالفة، تحت إشراف طبيب الأسنان بالكلية. قد يشارك في الرعاية كجزء من البرنامج التعليمي.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">2- تصريح المعلومات<span dir=\"LTR\">:</span></p>\r\n\r\n<p dir=\"RTL\">المستشفى في كلية طب الأسنان مخوَّل لتقديم معلومات من سجل المريض لإحالة الطبيب / أطباء الأسنان وغيرهم فيما يتعلق بطلب المساعدة، أو المساعدة الطبية / طب الأسنان التي يحق للمريض الحصول عليها.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<h2 dir=\"RTL\">3- موافقة طب الأسنان</h2>\r\n\r\n<p dir=\"RTL\">المريض تحت رعاية أطباء الأسنان بالكلية. يوافق المريض أو ممثليه / ها على العلاجات أو الإجراءات (باستثناء الإجراءات الغازية التي تتطلب موافقة خاصة)، والفحوص الشعاعية، والصور الشفوية والإضافية التي يلتقطها شخص مرخص له، والإجراءات المختبرية، وإدارة التخدير الموضعي ، وغيرها من الخدمات المقدمة في إطار الخدمات العامة والخاصة تعليمات من أطباء الأسنان أعضاء هيئة التدريس أو غيرها من الكلية ، موظفي كلية طب الأسنان المساعدة في رعاية المرضى.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\">يتم قبول المرضى في العيادات التعليمية في الرعاية على أساس تقييم الصور الإشعاعية وفحص المريض. يعتمد القبول على احتياجات وقدرات الطلاب ورغباتهم واحتياجاتهم. سيتم إبلاغ المرضى الذين لم يتم قبولهم بعد موعد الفحص.</p>\r\n\r\n<p dir=\"RTL\">يتم تشجيع المرضى على مناقشة مخاوفهم وتوقعاتهم، وطرح الأسئلة لتعزيز أعلى مستوى من الرعاية. وتناقش مخاطر وفوائد الإجراءات الموصي بها وكذلك العلاج البديل بحيث يمكن اتخاذ قرارات واضحة. ومع ذلك، بسبب تباين استجابات المريض وقيود العلاج، لم يتم تقديم أي ضمان لأي إجراء.</p>\r\n\r\n<p dir=\"RTL\">يجب أن يكون المرضى متاحين لمدة 3 ساعات، في كثير من الأحيان مرتين في الأسبوع، ويجب أن يقدموا رقم هاتف حيث يمكن الوصول إليهم يوميًا. نظرًا لتخصيص المرضى للطلاب الذين يعملون تحت إشراف دقيق لأطباء الأسنان بالكلية، يستمر العلاج بوتيرة أبطأ بكثير من مكتب طبيب الأسنان الخاص، ولا يمكن ضمان إكمال الإجراءات خلال فترة زمنية محددة.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong><u>اتفاقية خدمات طب الأسنان</u></strong></p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">يجب على المرضى تقديم إشعار لمدة 24 ساعة على الأقل لإلغاء المواعيد؛ وإلا سوف تعتبر المواعيد &quot;غياب&quot;. إذا فشل المريض في الظهور في المواعيد المحددة أو وصل متأخراً لأكثر من 20 دقيقة، فسيتم اعتبار المواعيد &quot;غياب&quot;. موعدين من المواعيد &quot;الغياب &ldquo;سوف تتم مراجعة الملف وإمكانية حرمان المريض من إنهاء العلاج.</li>\r\n</ul>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<ul>\r\n	<li dir=\"RTL\">جميع سجلات المرضى هي ملك كلية طب الأسنان</li>\r\n</ul>\r\n\r\n<p style=\"margin-left:36.0pt\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong><u>اتفاقية</u></strong></p>\r\n\r\n<p dir=\"RTL\">كلية طب الأسنان والمريض أو ممثله، بموجب هذا الاتفاق. يشهد المريض أو ممثليه بأنه قد قرأ ووافق على شروط وأحكام الخدمة هذه وأنه هو المريض أو مخول له حسب الأصول بتنفيذ هذا الاتفاق والاتفاق نيابة عن المريض.</p>\r\n\r\n<p dir=\"RTL\">&nbsp;</p>\r\n\r\n<p dir=\"RTL\"><strong><u>تعليمات قبول هذه الشروط والأحكام</u></strong></p>\r\n\r\n<p dir=\"RTL\">المريض قاصر: يجب على الوالد أو الوصي قبول هذه الشروط والأحكام كممثل للمريض ما لم يُسمح للمريض قانونًا بالموافقة على الرعاية الطبية.</p>\r\n\r\n<p dir=\"RTL\"><strong><u>هام</u></strong></p>\r\n\r\n<p dir=\"RTL\">1- قد تتطلب بعض العلاجات دفع رسوم رمزية للمواد أو الادوات ولكن لايزال طبيب الاسنان مجاني.</p>\r\n\r\n<p dir=\"RTL\">2- التواصل مع الطبيب في حال عدم التمكن من الحضور او الرغبة في الغاء الموعد.</p>\r\n\r\n<p dir=\"RTL\">3- طالب طب الاسنان غير مخول لتحويل المريض للمستشفيات او مراكز الرعاية الحكومية او الخاصة.</p>\r\n\r\n<p dir=\"RTL\">4- تجديد الموعد عن طريق تطبيق طبيب اسنان مجاني يسهل طريق علاجك. كما تتعرف على ملف طبيبك المعالج.</p>\r\n\r\n<p dir=\"RTL\">5- للأهمية التواصل بين المريض والطبيب فان رقم هاتفك المسجل سيظهر في تفاصل المواعيد.</p>\r\n\r\n<p dir=\"RTL\">6- طبيب أسنان مجاني يخلي مسؤوليته من أي خلاف ينشأ بين الطرفين</p>\r\n\r\n<p dir=\"RTL\">7- اللغة العربية هي المعتمدة في الشروط الاحكام أما اللغة الإنجليزية فتمثل مجرد ترجمة.</p>\r\n\r\n<p dir=\"RTL\">8- بياناتك المسجلة سوف تظهر في سجلات المواعيد لدى الطبيب او المريض للاطلاع على الحالة وذلك لأهميتها في قبول او رفض الطلب&nbsp;</p>\r\n\r\n\r\n\r\n\r\n<p dir=\"RTL\">تاريخ التحديث 3/9/2019م</p>\r\n', '<p><strong>Terms and conditions</strong></p>\r\n\r\n<p><strong><u>introduction</u></strong><strong>:</strong></p>\r\n\r\n<p>This agreement is a contract between a free dentist and those who use their website or phone applications, whether the user is registered or not, and with the user&#39;s consent to the terms of the site can access and use in accordance with the terms of the agreement. This introduction is part of this Agreement and the conditions are:</p>\r\n\r\n<p><strong><u>Terms of use:</u></strong></p>\r\n\r\n<p>A free dentist will in no way be liable for incidental, direct, indirect, special, punitive, typical or consequential damages, which may arise as a result of your use or inability to use the Site. By using the Site, you agree to: Terms and Conditions.</p>\r\n\r\n<p>1. The confidentiality of information given and provided under this system is the sole responsibility of the subscriber.</p>\r\n\r\n<p>2. The Subscriber (User), once using this system, waives in advance and does not accept to veto any complaints, claims or claims arising from the use of the free dentist website and mobile application.</p>\r\n\r\n<p>3. The free dentist site and application is not responsible for any delay or deterioration in the quality of service, poor performance or interruption of the service for any reason whatsoever, and the subscriber (user) drops any claim against a free dentist in this regard.</p>\r\n\r\n<p>4. The subscriber (the user) undertakes not to misuse the software and shall be solely responsible for the misuse of the software.</p>\r\n\r\n<p>6. Familiar with the procedures, systems and regulations of the service in its normal form and its commitment not to violate these procedures and work to meet the requirements of providing the service.</p>\r\n\r\n<p><strong><u>the use:</u></strong></p>\r\n\r\n<p>You agree to access and use the Site solely for lawful purposes, and are fully aware of all laws, regulations, rules, terms and conditions relating to your use of the Site and the Mobile App, and once you access the Site you agree to refrain from:</p>\r\n\r\n<p>1. Use the Site to commit a crime or encourage others to engage in any conduct that may be considered a crime or involve civil liability.</p>\r\n\r\n<p>2. Introduce or publish any unlawful content that includes discrimination, defamation, abuse, defamation or obscenity against any party or pornographic material.</p>\r\n\r\n<p>3. Use the Site to impersonate other persons or parties.</p>\r\n\r\n<p>4. Use of the Site to download any material that contains software that contains viruses, spyware, computer codes, files or programs that may alter, damage or impede the operation of the Site or any device or software belonging to any person who accesses the Site.</p>\r\n\r\n<p>5. Upload, enter, transmit or broadcast any material that you are not entitled to transmit under any law or contractual relationship.</p>\r\n\r\n<p>6. Change, destroy or delete any content on the site.</p>\r\n\r\n<p>7. Disable normal lines of communication in any form.</p>\r\n\r\n<p>8. Claiming to associate with or represent any company, association or body without being authorized to claim that relationship or representation.</p>\r\n\r\n<p>9. Publish or broadcast any advertisement, advertising material or any form of promotion without prior agreement.</p>\r\n\r\n<p>10. Publish any material that is inconsistent with or contrary to the intellectual property rights of others.</p>\r\n\r\n<p>11. Collect or store personal information about others.</p>\r\n\r\n<p><strong><u>Amendment of the Convention:</u></strong></p>\r\n\r\n<p>A free dentist has the right to amend these terms and conditions and to be notified of changes to this page. The amendments will enter into force as soon as they are made. Your repeated use of the site or mobile app after making these changes means you agree to the amendments, and you should periodically visit this page to review Terms and Conditions of Use.</p>\r\n\r\n<p><strong><u>Registration:</u></strong></p>\r\n\r\n<p>Some parts of the site or mobile app are open only to registered members and / or allow the user to request support or services electronically by entering personal information. You agree that any information you provide to us through those parts is complete and accurate, you will not attempt to access the site using someone else&#39;s name and will not adopt a username that a free dentist may deem inappropriate.</p>\r\n\r\n<p><strong><u>Termination of use:&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </u></strong></p>\r\n\r\n<p>A free dentist has the right to terminate or suspend your access or use of this website or mobile application without prior notice due to your violation of these terms or applicable laws or because of any action that a free dentist may find to be contrary to international agreements and customs or harmful to others. You will not be able to access the site or the mobile app, and a free dentist will have all the means available to apply this prohibition.</p>\r\n\r\n<p><strong><u>Compensation:</u></strong></p>\r\n\r\n<p>You agree to defend the interests of a free dentist at any official or unofficial authority due to any financial or non-financial claim resulting from your breach of any of the terms of this Agreement and as a result you incur all financial and non-financial costs resulting from your breach of any of these terms. The Agreement, whether insurance, indemnity, fees or any other financial or non-financial costs, and any settlement made by any official or non-official body because of a violation of any of the terms of this Agreement shall not become valid and effective only with the express and written consent of a free dentist.</p>\r\n\r\n<p><strong><u>Waiver of Warranty:</u></strong></p>\r\n\r\n<p>You clearly understand and agree that your use of the Site, the Mobile App or any material available through it is at your own risk, and no free dentist or any of its employees warrant that the Website or the Mobile App will not be interrupted or free from problems, deletion or errors, there is no guarantee as to the outcome of your use of the Site or the Mobile App. The contents and tools on the Site are provided to you without any warranties of any kind, either express or implied.</p>\r\n\r\n<p><strong><u>Consent</u></strong></p>\r\n\r\n<p>Hospital in College of Dentistry is a teaching institution. Treatment is provided by the student under the supervision of academic faculty.</p>\r\n\r\n<p>Patients in the teaching clinics are accepted into care based upon assessment by the faculty dentist after initial screening (treatment not included).</p>\r\n\r\n<p>The treatment provided will require the patient to attend several appointments for more than 2-hours.</p>\r\n\r\n<p>The treatment procedures must be done during student clinic hours.</p>\r\n\r\n<p>I understand that the Dental Assessment I will receive today does not constitute a dental check-up, Dental examination, or second opinion, and that I should continue to see a dentist to maintain my Dental Health unless and/or until I receive notice that I have been accepted as a patient in the hospital&nbsp; of College of Dentistry.</p>\r\n\r\n<p>I also understand that the sole purpose of my visit to the hospital of College of Dentistry.</p>\r\n\r\n<p>Dental Clinic today is to be assessed for admission as a patient in the Undergraduate Teaching Clinic. If the dentist&rsquo;s visual assessment indicates I would not be an appropriate patient, I should seek dental treatment elsewhere.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Only if the dentist who looks at my mouth believes my dental needs may match those of the dental students who provide treatment in the teaching clinic, will the dentist refer me the Oral Radiology Clinic to have oral radiographs (x-rays taken). Based upon the dentist&rsquo;s visual assessment and his/her assessment of my radiographs, a final decision will be made about whether I am an appropriate patient. I will be notified of that decision.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>GENERAL INFORMATION AND CONSENT</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; TEACHING INSTITUTION: </strong></p>\r\n\r\n<p>hospital in College of Dentistry, is a teaching institution. Students, interns, residents, and other allied dental healthcare professionals, under the supervision of faculty dentist. May participate in care as part of the educational program.</p>\r\n\r\n<p><strong>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; RELEASE OF INFORMATION: </strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>hospital in College of Dentistry is authorized to furnish information from the patient&rsquo;s record to referring physician / dentists and others to the extent required in connection with the claim for aid, or medical / dental assistance to which the patient may be entitled.</p>\r\n\r\n<p><strong>c.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; DENTAL CONSENT</strong></p>\r\n\r\n<p>The patient is under the care of faculty dentists. The patient or his/her representative consents to treatments or procedure (except invasive procedures requiring special consent), radiographic examinations, intraoral and extra oral photographs taken by an authorized person, laboratory procedures, local anesthetic administration, and other service rendered under general and special instructions of faculty dentists or other from college, College of Dentistry personnel assisting in patient care.</p>\r\n\r\n<p>Patients in the teaching clinics are accepted into care based upon assessment of radiographs and the intake screening. Acceptance is based upon needs and abilities of students, and desires, needs, and availability of patients. Patients who are not accepted subsequent to their screening appointment will be advised.</p>\r\n\r\n<ol>\r\n	<li>Patients are encouraged to discuss their concerns and expectations, and to ask questions to promote the highest level of care. The risks and benefits of recommended as well as alternative treatment procedures are discussed so that informed decisions may be made. However, due to the variability of patient responses and limitations of treatment, no guarantee or warranty is made for any procedure.</li>\r\n</ol>\r\n\r\n<p style=\"margin-left:9.0pt\">&nbsp;</p>\r\n\r\n<ol>\r\n	<li>Patients must be available for 3-hour appointments, as often as twice a week, and must provide a phone number where they can be reached daily. Because patients are assigned to students working under the close supervision of faculty dentists, treatment proceeds at a significantly slower pace than in a private dentist&rsquo;s office, and completion of procedures cannot be assured within a given period of time.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:18.0pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:18.0pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:18.0pt\">&nbsp;</p>\r\n\r\n<p style=\"margin-left:21.3pt\">&nbsp;</p>\r\n\r\n<p><strong>DENTAL SERVICES AGREEMENT</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>Patients must give a minimum of 24-hours&rsquo; notice to cancel appointments; otherwise appointments will be considered &ldquo;absent&rdquo;. If patient fails to show up for scheduled appointments or arrive more than 20 minutes late, appointments will be considered &ldquo;absent&rdquo;. Two &ldquo;absent&rdquo; appointments constitute grounds for revising file and possible termination of treatment</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n	<li>All patient records are property of the College of Dentistry</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"margin-left:18.0pt\">&nbsp;</p>\r\n\r\n<p><strong>AGREEMENT</strong></p>\r\n\r\n<p>College of Dentistry and the patient or his/ her representative, hereby enter into this agreement. The patient or his/her representative certifies that he/she has read and accepted of this TERMS AND CONDITIONS OF SERVICE and is the patient or is duly authorized to execute and agreement on behalf of the patient.</p>\r\n\r\n<p style=\"margin-left:21.3pt\"><strong>INSTRUCTIONS FOR ACCEPTING OF THIS TERMS AND CONDITIONS REQUIREMENTS</strong></p>\r\n\r\n<p style=\"margin-left:21.3pt\">&nbsp;</p>\r\n\r\n<p>PATIENT IS A MINOR:&nbsp; The parent or guardian must be accepting of this TERMS AND CONDITIONS as Patient&rsquo;s Representative unless the patient is legally allowed to consent to medical care.</p>\r\n\r\n<p><strong>Important</strong></p>\r\n\r\n<p>1.&nbsp; Some treatments may require a small fee for materials or tools, but the dentist is still free</p>\r\n\r\n<p>2.&nbsp; Communicate with your doctor if you cannot attend or wish to cancel the appointment.</p>\r\n\r\n<p>3. A dental student is not authorized to transfer the patient to hospitals or government or private care centres.</p>\r\n\r\n<p>4. Renew your appointment by applying a free dentist that will make your treatment easier.</p>\r\n\r\n<p>A free dentist disclaims any dispute between the parties.</p>\r\n\r\n<p>The Arabic language is approved in terms and conditions and English is just a translation.</p>\r\n\r\n<p>Your recorded data will appear in the appointment records of the doctor or patient to see the case due to its importance in accepting or rejecting the application</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n\r\n<p>Last updated 3/9/2019</p>\r\n', 5, NULL, NULL, '2019-06-03 09:38:56', '2019-11-03 11:00:11');
